import './register.css';
import React, { useState } from 'react';

function Register() {
  const [state, setState] = useState({
    firstName:'',
    lastName:'',
    email:''
  })
  const handleFirstNameInput =() => {
    setState(...state,firstName)
  };
  
  return (
    <>
    <div className='all'>
      <form className='register' >
        <input
          type='text'
          className = 'form'
          name = 'firstName'
          placeholder = 'First Name'
        />
        <input
          type='text'
          className = 'form'
          name = 'lastName'
          placeholder = 'Last Name'
        />
        <input
         type='email'
         className = 'form'
         name = 'email'
         placeholder = 'Email'
        />
        <button type='submit'>
          Register
        </button>
      </form>
    </div>
  </>

  );
    
}

export default Register;
